import React from "react";
import axios from "axios";
import {useSelector} from "react-redux";
import history from '../../history';

const StructureAdminDeliveries = (props) => {

    const { auth } = useSelector( state => ({
        auth: state.auth,
        }));  

        const data = props.info;

        const SetDelivered = () => { 
            axios.put("/api/cityrunner/deliverydetailsdelivered", data)
            .then(() => {
                console.log(`delivery info set to delivered`);
                history.push('/admindashboarddeliveries')

            }).catch((error) => {
                console.log(error); 
            });
        }

        const SetPartial = () => {
            axios.put("/api/cityrunner/deliverydetailspartial", data)
            .then(() => {
                console.log(`delivery info set to partial`);
                history.push('/admindashboarddeliveries')

            }).catch((error) => {
                console.log(error); 
            });
        }


        const SetRescheduled = () => {
            axios.put("/api/cityrunner/deliverydetailsrescheduled", data)
            .then(() => {
                console.log(`delivery info set to rescheduled`);
                history.push('/admindashboarddeliveries')

            }).catch((error) => {
                console.log(error); 
            });
        }

        const SetCancelled = () => {
            axios.put("/api/cityrunner/deliverydetailscancelled", data)
            .then(() => {
                console.log(`delivery info set to cancelled`);
                history.push('/admindashboarddeliveries')

            }).catch((error) => {
                console.log(error); 
            });
        }

        const SetRejected = () => {
            axios.put("/api/cityrunner/deliverydetailsrejected", data)
            .then(() => {
                console.log(`delivery info set to rejected`);
                history.push('/admindashboarddeliveries')

            }).catch((error) => {
                console.log(error); 
            });
        }





    return (
        <tr >
           <td > 
                {props.id}
            </td>
            <td>
                {props.user}
            </td>
            <td>
                {props.pickupitem} 
            </td>
            <td>
                {props.pickupaddress}  
            </td>
            <td>
                {props.name}
            </td>
            <td>
                {props.phone}
            </td>
            <td>
                {props.email}
            </td>
            <td>
                {props.pickupdate}
            </td>
            <td>
               {props.amountInNaira} 
            </td>
            <td>
               {props.weightinkg} 
            </td>
            <td>
                {props.pickupquantity}
            </td>
            <td>
                {props.deliveryaddress}
            </td>
            <td>
                {props.deliveryname}
            </td>
            <td>
                {props.deliveryphonenumber}
            </td>
            <td>
                {props.deliveryemail}
            </td>
            <td>
                {props.status}
            </td> 
            <td>
                {props.rider} 
            </td> 
            <td>
                {props.deliverydetails}
            </td> 
            <td onClick={SetDelivered}>
                Set order details as Delivered
            </td> 
            <td onClick={SetPartial}>
                Set order details as Partial Delivery
            </td> 
            <td onClick={SetRescheduled}>
                Set order details as Rescheduled
            </td> 
            <td onClick={SetCancelled}>
                Set order details as Cancelled
            </td> 
            <td onClick={SetRejected}>
                Set order details as Rejected
            </td> 
        </tr>
    );

}

export default StructureAdminDeliveries;
